import React from 'react';



import '../App.css';

var buttonPressed = "1"

export default class MessageContainer extends React.Component {
  constructor(props) {
    super(props);

    this.state = ({
      selectedObjects: [],
      total:0,
      page:"Inicioo",
    });
  }

  manageButtonsState = () => {
    var i  = 0;
    this.props.data.map((d) => {
      if(i===0){
        buttonPressed = d
      }
      i+=1
      return(<li>{d}</li>)
    })
    i=0
    switch (buttonPressed) {
      case a:
        return <Page />;
      case b:
        return <AnotherPage />;
      default:
        return <SomeDefaultPage />;
    }
  }

  render(){
    return (
      <div className="AppFS">
        {this.obtainButtonsState()}
      </div>
    )
  }
}
